    for (i, action) in enumerate(actions):
        if action.startswith('employee'):
            if current_employee:
                online_time[current_employee] = total_online_time
            current_employee = action
            online_start = i
            total_online_time = 0
            leave_count = 0
        elif action == 'online':
            online_start = i
        elif action == 'offline':
            total_online_time += i - online_start - leave_count
        elif action == 'leave':
            leave_count += -1
    if current_employee:
        online_time[current_employee] = total_online_time
    return online_time
